import { IonPage, IonHeader, IonToolbar, IonButtons, IonBackButton, IonTitle, IonContent, IonButton, IonIcon, IonPopover } from "@ionic/react";
import React, { useState } from "react";
import { chevronBack, ellipsisVerticalOutline } from "ionicons/icons";
import './NumericalIndex.css';

const NumericalIndex: React.FC = () => {
  const [showPopover, setShowPopover] = useState(false);
    return (

        <IonPage id="NumericalIndexes">
      <IonHeader>
        <IonToolbar>
        <IonButtons  slot="start">
          <IonButton href="..">
            <IonIcon slot="icon-only" src="assets/icon/chevron-back-outline.svg"/>
            </IonButton>
        </IonButtons>
        <IonTitle>Alphabetical Index</IonTitle>
        <IonButtons slot="end">
          <IonButton class="actionButton" onClick={() => setShowPopover(true)}>
            <IonIcon slot="icon-only" src="assets/icon/ellipsis-vertical-outline.svg"/>
          </IonButton>
        </IonButtons>
        <IonPopover
            isOpen={showPopover}
            cssClass='my-custom-class'
            onDidDismiss={e => setShowPopover(false)}>
            <a>Notifications</a>
            <hr id="solid"></hr>
            <a>Settings</a>
          </IonPopover>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
      </IonContent>
    </IonPage>
    );
};
export default NumericalIndex;
